package com.beijunyi.leetcode;

import java.util.*;

import com.beijunyi.leetcode.difficulty.Medium;

/**
 * All DNA is composed of a series of nucleotides abbreviated as A, C, G, and T, for example: "ACGAATTCCG". When studying DNA, it is sometimes useful to identify repeated sequences within the DNA.
 *
 * Write a function to find all the 10-letter-long sequences (substrings) that occur more than once in a DNA molecule.
 *
 * For example,
 *
 * Given s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT",
 *
 * Return:
 * ["AAAAACCCCC", "CCCCCAAAAA"].
 */
public class RepeatedDnaSequences implements Medium {

  /**
   * The idea is to use rolling hash technique or in case of string search also known as Rabin-Karp algorithm.
   * As our alphabet A consists of only 4 letters we can be not afraid of collisions.
   * The hash for a current window slice could be found in a constant time by:
   *   1, subtracting the former first character times size of the A in the power of 9
   *   2, updating remaining hash by the standard rule: hash = hash * A.size() + curr_char.
   */
  public static class Solution {

    public List<String> findRepeatedDnaSequences(String s) {

      Map<Character, Integer> alphabet = new HashMap<>();
      alphabet.put('A', 0);
      alphabet.put('C', 1);
      alphabet.put('G', 2);
      alphabet.put('T', 3);

      Set<String> res = new HashSet<>();
      Set<Integer> hashes = new HashSet<>();
      for (int i = 0, rhash = 0; i < s.length(); i++) {
        if (i >= 10)
          rhash -= Math.pow(alphabet.size(), 9) * alphabet.get(s.charAt(i - 10));
        rhash = alphabet.size() * rhash + alphabet.get(s.charAt(i));

        if (i >= 9 && !hashes.add(rhash))
          res.add(s.substring(i - 9, i + 1));
      }
      return new ArrayList<>(res);
    }
  }

  public static void main(String args[]) {
    System.out.println(new Solution().findRepeatedDnaSequences(""));
  }

}
